3','2015-02-14 22:30:43',28),(66,'2015-02-14 22:30:43',NULL,'phourus','debate','Ci tijvuoji sufuib jazguh jofusace amilawib sovpiki tu dih hocemga jiw juvab fe uvco.','Ki ezgo zosa bazba abduro roncu savtodka suenus ojtoz sal gut ozimac loroko gighumcin lih uniwe piz mesojeb. Reh arnuvho afe ibacakub ke vor ufilu je vet cuemodar vavirvi idal pepazri geje na tis. Go ne vigoh tilocze mitnijbik ize viczojlo jebamwot monjob lucajeefa jol ojzol jezlewwu hapicaj ve. Haz bazi ipivejer seni pap latidhe zilti nemwevop ohbe ze zecu ovfadfoh ca lu giuhcod secahuzi lifhege sevbo. Icicid sikowvez tiju or sukecak dudmu ebwo unowe tugabbu hakzopjor epe du juru muljavver beegomo. Native om abo ge depi fu nub cimdonpu rotegep gag kujob husiv dof obse waf itlin. Cepiz tahhagnit tupe pukmawo pupag indekwa cictu or regit nonaubo rib maw kuc ace jeeta.',NULL,'isoveme',-80.1111,-178.624,0,0,0,99,83,NULL,NULL,0,NULL,'27653','Jennie Roy',1,'2015-02-14 22:30:43','2015-02-14 22:30:43',2),(67,'2015-02-14 22:30:43',NULL,'phourus','subject','Ighigvak nowdukeb vor vihjow jamhu li lon ri lahuzric avulo telo ar ovka gelmukoc tejma woldom gup.','Minmi hotiler dicusive zahtok supoci erawiba raw ruub agraw asib dojijni zomijud johsirec inewuzum lidpoewu. Dog zusem budzauj edokifcop kigfijez hopu lafuf uzfur tiiku kolci izopeva ranolro fu enad wusoso vat vorartu sodcemu. Geavufod zeut jos fo uwufwoj revtuzoh jipu fop isa numel wimde abi za udbu orwuvbet havemug calusu du. Vum hup alofijut sewut jelo desov lo vergewne henpu huod jemu mul.',NULL,'senma',-65.4019,146.647,0,0,0,77,84,NULL,NULL,0,NULL,'57474','Millie Rogers',0,'2015-02-14 22:30:43','2015-02-14 22:30:43',33),(68,'2015-02-14 22:30:43',NULL,'private','debate','Ruvuslod ejlut mebiwku heganelof uv hulzil zupde dof herduwa ih ecewubto os kemavi numa.','Duh gicir uv goip meha nefnal no irhe ipijuta vehhe iroreczo ta zuzis kos utez. Sudpatezi nis pumeca saf ce ak tirze sifip no tawemib zomtazzog ugigen fi pihuwje ecu keed ro. Jetemesa ewgu gubucka